  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;rnt&lt;span style=\"font-family:
  &amp;quot;Lucida Grande&amp;quot;;\"&gt;This project develops a process for automated
  on-orbit construction of very large structures and multifunctional components. The
  foundation of this process is a novel additive manufacturing technique called &amp;lsquo;SpiderFab&amp;rsquo;,
  which combines the techniques of fused deposition modeling (FDM) with methods derived
  from automated composite layup to enable rapid construction of very large, very
  high-strength-per-mass, lattice-like structures combining both compressive and tensile
  elements.&lt;/span&gt;&lt;/p&gt;rn&lt;script id=\"dstb-id\" language=\"javascript\"&gt;rnif(typeof(dstb)!=
  \"undefined\"){ dstb();}&lt;/script&gt;rn\",\n\t\"license_title\": \"U.S. Government
